void problem_8() {
    double num = 0.;
    long temp = 1, result = 0;
    int temp_num;
    
    for (int i = 0; i < 1000 - 13; i++){
        for (int j = 0; j < 13; j++){
            temp_num = num*10;
            temp = temp*temp_num;
            num -= temp_num;
        }
        if (temp > result){
            result = temp;
        }
        temp = 1;
    }
    printf("%ld\n", result);
}

